import styled from 'styled-components';

export const Container = styled.div`
	height: 100vh;
	width: 100vw;
	background-color: white;
	overflow: hidden;
	position: absolute;
	top: 0;
	left: 0;
	right: 0;
	bottom: 0;
	z-index: 150;
`;
